    "Use a timed exam to limit the time learners can spend on problems in this subsection. Learners must submit answers before the time expires. You can allow additional time for individual learners through the Instructor Dashboard.": "\u6642\u9593\u5236\u9650\u4ed8\u304d\u8a66\u9a13\u3092\u4f7f\u3063\u3066\u3001\u53d7\u8b1b\u8005\u304c\u3053\u306e\u30b5\u30d6\u30bb\u30af\u30b7\u30e7\u30f3\u306e\u554f\u984c\u306b\u8cbb\u3084\u305b\u308b\u6642\u9593\u3092\u5236\u9650\u3057\u3066\u304f\u3060\u3055\u3044\u3002\u53d7\u8b1b\u8005\u306f\u6642\u9593\u5207\u308c\u306b\u306a\u308b\u524d\u306b\u89e3\u7b54\u3092\u63d0\u51fa\u3057\u306a\u3051\u308c\u3070\u306a\u308a\u307e\u305b\u3093\u3002\u8b1b\u5e2b\u7528\u30c0\u30c3\u30b7\u30e5\u30dc\u30fc\u30c9\u304b\u3089\u53d7\u8b1b\u8005\u3054\u3068\u306b\u6642\u9593\u5ef6\u9577\u3059\u308b\u3053\u3068\u3082\u3067\u304d\u307e\u3059\u3002",
